import React from "react";
import { useState } from "react";
import CatalogDataJSON from '../../Catalog.json'

function SelectTour(item) {
    const [tour, setTour] = useState("")
    const arrTours = [
        CatalogDataJSON.CatalogRU[0].Name,
        CatalogDataJSON.CatalogRU[1].Name,
        CatalogDataJSON.CatalogRU[2].Name,
        CatalogDataJSON.CatalogRU[3].Name,
        CatalogDataJSON.CatalogRU[4].Name
    ];
    const arrToursTemp = arrTours.map((n) => 
        <option>{n}</option>
    )
    return(
        <div>
            <label htmlFor="selectTour">Количество человек</label>
            <select className="selectTour" id="selectTour" onChange={
                (e) => {
                    setTour(e.target.value)
                }}>
                {arrToursTemp}
            </select>
        </div>
    );
}
export default SelectTour;
